import React, { useState } from 'react';
import './Calculator.css';

const Calculator = () => {
  const [input, setInput] = useState('');
  const [result, setResult] = useState('');
  const [exponent, setExponent] = useState(''); // New state for exponent

  const handleInput = (value) => {
    setInput(input + value);
  };

  const handleExponentInput = (value) => {
    setExponent(exponent + value);
  };

  const calculateResult = () => {
    try {
      setResult(eval(input).toString());
    } catch (error) {
      setResult('Error');
    }
  };

  const clearInput = () => {
    setInput('');
    setResult('');
    setExponent('');
  };

  const calculateSquareRoot = () => {
    try {
      setResult(Math.sqrt(eval(input)).toString());
    } catch (error) {
      setResult('Error');
    }
  };

  const calculateFactorial = () => {
    try {
      let num = eval(input);
      let factorial = 1;
      for (let i = 1; i <= num; i++) {
        factorial *= i;
      }
      setResult(factorial.toString());
    } catch (error) {
      setResult('Error');
    }
  };

  const calculateNaturalLog = () => {
    try {
      setResult(Math.log(eval(input)).toString());
    } catch (error) {
      setResult('Error');
    }
  };

  const calculatePower = () => {
    try {
      const base = eval(input);
      const exp = eval(exponent);
      setResult(Math.pow(base, exp).toString());
    } catch (error) {
      setResult('Error');
    }
  };

  return (
    <div className="calculator">
      <div className="display">
        <input type="text" value={input} placeholder="Base (x)" readOnly />
        <input
          type="text"
          value={exponent}
          placeholder="Exponent (b)"
          onChange={(e) => setExponent(e.target.value)}
        />
        <div className="result">{result}</div>
      </div>
      <div className="buttons">
        <button onClick={() => handleInput('1')}>1</button>
        <button onClick={() => handleInput('2')}>2</button>
        <button onClick={() => handleInput('3')}>3</button>
        <button onClick={() => handleInput('+')}>+</button>
        <button onClick={() => handleInput('4')}>4</button>
        <button onClick={() => handleInput('5')}>5</button>
        <button onClick={() => handleInput('6')}>6</button>
        <button onClick={() => handleInput('-')}>-</button>
        <button onClick={() => handleInput('7')}>7</button>
        <button onClick={() => handleInput('8')}>8</button>
        <button onClick={() => handleInput('9')}>9</button>
        <button onClick={() => handleInput('*')}>*</button>
        <button onClick={() => handleInput('0')}>0</button>
        <button onClick={() => handleInput('.')}>.</button>
        <button onClick={calculateResult}>=</button>
        <button onClick={() => handleInput('/')}>/</button>
        <button onClick={clearInput}>C</button>
        <button onClick={calculateSquareRoot}>√</button>
        <button onClick={calculateFactorial}>!</button>
        <button onClick={calculateNaturalLog}>ln</button>
        <button onClick={calculatePower}>x^b</button> {/* Updated power button */}
      </div>
    </div>
  );
};

export default Calculator;
